// React
import React from 'react';

// Bootstrap
import { 
    Row, 
    Col
  } from 'react-bootstrap';

// Import components
import Navigation from './Navigation.js';
import Footer from './Footer.js';

// Import CSS for the page and content
import './css/Page.css';
import './css/RedMirage.css';

// Import images
import redMirageMap from './images/red_mirage_map.svg';

// Content for Red Mirage
function RedMirage() {

    // No transition for the navigation on pages
    return (
        <div>
            <Navigation transition={ false }/>

                {/* Receive the content */}
                <div className='container-page'>
                    <div className='container-content'>

                        {/* Title section */}
                        <img src={ redMirageMap } alt="Red Mirage" className='red-mirage-map mb-4' />
                        <h1 className='page-title mb-4'>Anticipating the Red Mirage</h1>

                        {/* Summary text */}
                        <Row>
                            <Col md={ 6 } className='text-left'>
                                <p>
                                    While working as a data scientist at <a target="_blank" rel="noreferrer" href="https://www.linkedin.com/company/hawkfish/">Hawkfish</a> during 2020,
                                    my team polled Americans on their voting method preferences for the general election.
                                </p>
                                <p>
                                    A record number of voters planned to mail in or drop off their ballot to avoid in-person interactions at the polls.
                                </p>
                            </Col>
                        </Row>
                    </div>
                </div>

            {/* Close out the page with the footer */}
            <Footer />
        </div>
    );
}

export default RedMirage;
